// Import Styled
import styled from 'styled-components';

export const IconNotification = styled.text`
	box-sizing: border-box;
	background: none;
	font-size: 21px;
	color: #fff;
	margin-right: 16px;
	position: relative;
	.number{
	    position: absolute;
	    top: -10px;
	    right: -18px;
	    font-size: 13px;
	    line-height: 24px;
	    height: 26px;
	    width: 26px;
	    border: 2px solid #6573D6;
	    background-color: #4C5EBB;
	    border-radius: 50px;
	    text-align: center;
	}
`;
